<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>India Shawn</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Helvetica Neue', Arial, sans-serif;
            overflow-x: hidden;
            background: #000;
        }

        /* Header */
        header {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            z-index: 1000;
            padding: 20px 30px;
            display: flex;
            justify-content: space-between;
            align-items: center;
            background: transparent;
            width: 100%;
        }
        
        header .mobile-logo {
            height: 40px;
            display: block;
        }
        
        header .hamburger {
            margin-left: auto;
        }

        .logo {
            height: 40px;
        }

        .hamburger {
            display: flex;
            flex-direction: column;
            gap: 6px;
            cursor: pointer;
            z-index: 1001;
            width: 30px;
            height: 24px;
            position: relative;
            justify-content: center;
        }

        .hamburger span {
            width: 30px;
            height: 2px;
            background: #fff;
            transition: all 0.3s ease;
            position: absolute;
            left: 0;
        }
        
        .hamburger span:nth-child(1) {
            top: 0;
        }
        
        .hamburger span:nth-child(2) {
            top: 50%;
            transform: translateY(-50%);
        }
        
        .hamburger span:nth-child(3) {
            bottom: 0;
        }

        .hamburger.active span:nth-child(1) {
            top: 50%;
            transform: translateY(-50%) rotate(45deg);
        }

        .hamburger.active span:nth-child(2) {
            opacity: 0;
        }

        .hamburger.active span:nth-child(3) {
            bottom: 50%;
            transform: translateY(50%) rotate(-45deg);
        }

        /* Desktop Navigation */
        nav {
            display: none;
            align-items: center;
            width: 100%;
            padding: 0 60px;
            justify-content: space-between;
            position: relative;
        }
        
        nav a {
            color: #fff;
            text-decoration: none;
            font-size: 14px;
            letter-spacing: 1px;
            text-transform: uppercase;
            transition: opacity 0.3s;
        }

        nav a:hover {
            opacity: 0.6;
        }

        nav .logo {
            height: 35px;
            position: absolute;
            left: 50%;
            transform: translateX(-50%);
        }
        
        nav .nav-left,
        nav .nav-right {
            display: flex;
            justify-content: space-evenly;
            flex: 1;
        }

        /* Mobile Menu */
        .mobile-menu {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: #000;
            z-index: 999;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            gap: 40px;
            opacity: 0;
            pointer-events: none;
            transition: opacity 0.3s;
        }

        .mobile-menu.active {
            opacity: 1;
            pointer-events: all;
        }

        .mobile-menu a {
            color: #fff;
            text-decoration: none;
            font-size: 24px;
            letter-spacing: 2px;
            text-transform: uppercase;
            transition: opacity 0.3s;
        }

        .mobile-menu a:hover {
            opacity: 0.6;
        }

        /* Main Content */
        main {
            padding-top: 80px;
        }
        
        .mobile-albums-wrapper {
            min-height: calc(100vh - 80px);
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            background: #000;
        }
        
        .mobile-logo-container {
            display: flex;
            justify-content: center;
            align-items: center;
            padding: 40px 30px 20px;
            background: #000;
        }
        
        .mobile-logo-container .music-logo {
            max-width: 300px;
            width: 80%;
            height: auto;
        }

        /* Album Section - Mobile */
        .album-item {
            min-height: auto;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            padding: 20px 30px;
            position: relative;
        }
        
        .album-item:first-of-type {
            padding-top: 20px;
        }

        .album-item.killswitch {
            background: #000;
        }

        .album-item.cottoncandy {
            background: #000;
        }

        .album-item.gone {
            background: #000;
        }

        .album-content {
            position: relative;
            width: 100%;
            max-width: 300px;
            display: flex;
            flex-direction: column;
            align-items: center;
        }
        
        .album-content:hover .listen-btn {
            border-color: #fff;
            transform: scale(1.05);
        }

        .album-cover-wrapper {
            position: relative;
            width: 100%;
            margin-bottom: 15px;
        }
        
        .album-clickable {
            cursor: pointer;
        }

        .album-cover {
            width: 200px;
            height: 200px;
            object-fit: cover;
            box-shadow: 0 20px 60px rgba(0, 0, 0, 0.3);
            position: relative;
            z-index: 2;
            transition: transform 0.3s ease;
        }

        .vinyl-disc {
            position: absolute;
            width: 200px;
            height: 200px;
            right: -30px;
            top: 0;
            z-index: 1;
            transition: transform 0.3s ease;
        }
        
        .album-cover-wrapper:hover .album-cover {
            transform: translateX(-10px);
        }
        
        .album-cover-wrapper:hover .vinyl-disc {
            transform: translateX(10px) rotate(45deg);
        }

        .listen-btn {
            display: inline-block;
            padding: 10px 30px;
            background: transparent;
            color: #fff;
            text-decoration: none;
            text-transform: uppercase;
            letter-spacing: 2px;
            font-size: 10px;
            font-weight: bold;
            border: 2px solid transparent;
            border-radius: 50px;
            transition: all 0.3s;
            margin-top: 10px;
        }

        .listen-btn:hover {
            border-color: #fff;
            transform: scale(1.05);
        }

        .social-links-container {
            position: fixed;
            bottom: 30px;
            left: 50%;
            transform: translateX(-50%);
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 20px;
            z-index: 99999;
        }
        
        .social-label {
            color: rgba(255, 255, 255, 0.7);
            text-transform: uppercase;
            letter-spacing: 2px;
            font-size: 11px;
            font-weight: normal;
            transition: opacity 0.3s ease;
            text-align: center;
        }
        
        .social-icons {
            display: flex;
            gap: 15px;
            align-items: center;
            justify-content: center;
            opacity: 0;
            position: absolute;
            left: 50%;
            transform: translateX(-50%);
            transition: all 0.3s ease;
            pointer-events: none;
        }
        
        .social-links-container:hover .social-label {
            opacity: 0;
        }
        
        .social-links-container:hover .social-icons {
            opacity: 1;
            pointer-events: all;
        }
        
        .social-icon {
            width: 40px;
            height: 40px;
            display: flex;
            align-items: center;
            justify-content: center;
            border-radius: 50%;
            transition: all 0.3s ease;
            color: #fff;
        }
        
        .social-icon svg {
            width: 20px;
            height: 20px;
        }
        
        .social-icon:hover {
            transform: scale(1.15);
        }
        
        .instagram-icon {
            background: linear-gradient(45deg, #f09433 0%, #e6683c 25%, #dc2743 50%, #cc2366 75%, #bc1888 100%);
        }
        
        .tiktok-icon {
            background: #000;
        }
        
        .x-icon {
            background: #000;
        }
        
        .youtube-icon {
            background: #FF0000;
        }
        
        /* Old social link styles - can be removed */
        .social-link {
            display: none;
        }
        
        .social-text {
            display: none;
        }
        
        /* Lightbox Modal */
        .lightbox {
            display: none;
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(0, 0, 0, 0.95);
            z-index: 9999;
            justify-content: center;
            align-items: center;
            backdrop-filter: blur(10px);
        }
        
        .lightbox.active {
            display: flex;
        }
        
        .lightbox-content {
            background: #1a1a1a;
            border-radius: 20px;
            padding: 50px 60px;
            max-width: 500px;
            width: 90%;
            position: relative;
            text-align: center;
        }
        
        .lightbox-close {
            position: absolute;
            top: 20px;
            right: 20px;
            font-size: 30px;
            color: #fff;
            cursor: pointer;
            background: none;
            border: none;
            width: 40px;
            height: 40px;
            display: flex;
            align-items: center;
            justify-content: center;
            transition: opacity 0.3s;
        }
        
        .lightbox-close:hover {
            opacity: 0.6;
        }
        
        .lightbox-album-cover {
            width: 150px;
            height: 150px;
            object-fit: cover;
            margin: 0 auto 20px;
            border-radius: 10px;
        }
        
        .lightbox-title {
            font-size: 28px;
            font-weight: bold;
            color: #fff;
            margin-bottom: 10px;
        }
        
        .lightbox-artist {
            font-size: 16px;
            color: rgba(255, 255, 255, 0.6);
            margin-bottom: 40px;
        }
        
        .streaming-links {
            display: flex;
            flex-direction: column;
            gap: 15px;
        }
        
        .streaming-link {
            display: flex;
            align-items: center;
            justify-content: center;
            padding: 15px 30px;
            background: #fff;
            color: #000;
            text-decoration: none;
            border-radius: 50px;
            font-weight: bold;
            text-transform: uppercase;
            letter-spacing: 1px;
            font-size: 14px;
            transition: all 0.3s;
        }
        
        .streaming-link:hover {
            transform: scale(1.05);
            background: #f0f0f0;
        }
        
        .streaming-link.spotify {
            background: #1DB954;
            color: #fff;
        }
        
        .streaming-link.apple {
            background: #FC3C44;
            color: #fff;
        }
        
        .streaming-link.youtube {
            background: #FF0000;
            color: #fff;
        }
        
        .streaming-link.tidal {
            background: #000;
            color: #fff;
            border: 2px solid #fff;
        }
        
        /* Social Lightbox Modal */
        /* Desktop Full Screen Pages */
        .videos-page {
            display: block;
            padding: 0;
        }
        
        .videos-page .fullscreen-page {
            display: flex;
        }
        
        .fullscreen-page {
            min-height: 100vh;
            position: relative;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            padding: 40px 20px;
            gap: 40px;
        }

        .fullscreen-page.killswitch {
            background: linear-gradient(180deg, #FF4B3E 0%, #E63946 100%);
        }

        .fullscreen-page.cottoncandy {
            background: linear-gradient(180deg, #FFB3D9 0%, #FF8FC7 100%);
        }
        
        .cottoncandy-logo {
            max-width: 500px;
            width: 80%;
            height: auto;
            object-fit: contain;
            animation: fadeInUp 1s ease-out;
        }

        .fullscreen-page.gone {
            background: linear-gradient(180deg, #4A90E2 0%, #357ABD 100%);
        }
        
        .gone-text-background {
            position: relative;
            width: 100%;
            display: flex;
            align-items: center;
            justify-content: center;
            pointer-events: none;
            z-index: 1;
        }
        
        .gone-text-background svg {
            width: 90%;
            max-width: 800px;
            height: auto;
        }
        
        .killswitch-text-background {
            position: relative;
            width: 100%;
            display: flex;
            align-items: center;
            justify-content: center;
            pointer-events: none;
            z-index: 1;
        }
        
        .killswitch-text-background svg {
            width: 90%;
            max-width: 800px;
            height: auto;
        }

        .title-overlay {
            position: relative;
            width: 100%;
            display: flex;
            align-items: center;
            justify-content: center;
            pointer-events: none;
            z-index: 1;
        }

        .title-text {
            font-size: clamp(60px, 12vw, 180px);
            font-weight: 900;
            color: rgba(255, 255, 255, 0.15);
            text-transform: uppercase;
            letter-spacing: -0.03em;
            font-style: italic;
        }

        .title-text.killswitch {
            font-family: 'Brush Script MT', cursive;
            font-style: normal;
        }

        .title-text.cottoncandy {
            font-family: 'Comic Sans MS', cursive;
        }

        .title-text.gone {
            font-family: 'Brush Script MT', cursive;
        }

        .video-container {
            position: relative;
            z-index: 2;
            width: 75%;
            max-width: 900px;
            aspect-ratio: 16 / 9;
            border-radius: 10px;
            overflow: hidden;
            box-shadow: 0 30px 80px rgba(0, 0, 0, 0.4);
        }

        .video-container iframe {
            width: 100%;
            height: 100%;
            border: none;
        }

        .video-label {
            position: relative;
            top: auto;
            left: auto;
            color: #fff;
            font-size: 12px;
            letter-spacing: 2px;
            text-transform: uppercase;
            margin-bottom: 15px;
            text-align: center;
        }

        /* Desktop Music Grid */
        .music-logo-container {
            display: none;
            justify-content: center;
            align-items: center;
            padding: 40px 60px 0;
            background: #000;
        }
        
        .music-logo {
            max-width: 400px;
            width: 100%;
            height: auto;
        }
        
        .music-grid {
            display: none;
            grid-template-columns: repeat(3, 1fr);
            gap: 40px;
            padding: 0 60px 60px;
            margin-top: -80px;
            min-height: 100vh;
            align-items: center;
            background: #000;
        }

        .music-grid-item {
            text-align: center;
        }
        
        .music-grid-item:hover .listen-btn {
            border-color: #fff;
            transform: scale(1.05);
        }

        .music-grid-item .album-cover-wrapper {
            margin-bottom: 20px;
        }

        .music-grid-item .album-cover {
            width: 100%;
            max-width: 300px;
            height: auto;
            aspect-ratio: 1;
        }

        .music-grid-item .vinyl-disc {
            width: 100%;
            max-width: 300px;
            height: auto;
            right: -30px;
        }

        /* Responsive Design */
        @media (min-width: 768px) {
            .hamburger {
                display: none;
            }
            
            header .mobile-logo {
                display: none;
            }
            
            .mobile-logo-container {
                display: none;
            }

            nav {
                display: flex;
            }

            .mobile-menu {
                display: none;
            }

            .album-item {
                display: none;
            }

            .music-grid {
                display: grid;
            }
            
            .videos-page {
                display: block;
            }
        }

        @media (max-width: 767px) {
            .music-grid {
                display: none !important;
            }
            
            .videos-page {
                display: block;
                padding: 0;
            }
            
            .videos-page .video-container {
                margin-bottom: 40px;
            }
            
            /* Mobile: Stack images above videos */
            .fullscreen-page {
                display: flex;
                flex-direction: column;
                padding: 0;
                min-height: 100vh;
            }
            
            .title-overlay,
            .killswitch-text-background,
            .gone-text-background {
                position: relative;
                width: 100%;
                height: auto;
                margin-bottom: 30px;
                pointer-events: auto;
            }
            
            .cottoncandy-logo {
                max-width: 100%;
                width: 90%;
                height: auto;
            }
            
            .killswitch-text-background svg,
            .gone-text-background svg {
                width: 90%;
                max-width: 400px;
            }
            
            .video-container {
                position: relative;
                width: 75%;
                max-width: 100%;
                margin: 0 auto;
            }
            
            .video-label {
                position: relative;
                top: auto;
                margin-bottom: 15px;
                text-align: center;
            }
        }
        
        @media (min-width: 768px) {
            .mobile-albums-wrapper {
                display: none;
            }
            
            .music-logo-container {
                display: flex;
            }
        }
    </style>
</head>

    <script>
        // Mobile menu toggle
        const hamburger = document.getElementById('hamburger');
        const mobileMenu = document.getElementById('mobileMenu');

        hamburger.addEventListener('click', () => {
            hamburger.classList.toggle('active');
            mobileMenu.classList.toggle('active');
        });

        // Close mobile menu when clicking a link
        const mobileLinks = mobileMenu.querySelectorAll('a');
        mobileLinks.forEach(link => {
            link.addEventListener('click', () => {
                hamburger.classList.remove('active');
                mobileMenu.classList.remove('active');
            });
        });
        
        // Smooth scroll with custom easing
        function smoothScrollTo(target, duration = 1500) {
            const targetElement = document.querySelector(target);
            if (!targetElement) return;
            
            const targetPosition = targetElement.getBoundingClientRect().top + window.pageYOffset;
            const startPosition = window.pageYOffset;
            const distance = targetPosition - startPosition;
            let startTime = null;
            
            function easeInOutCubic(t) {
                return t < 0.5 
                    ? 4 * t * t * t 
                    : 1 - Math.pow(-2 * t + 2, 3) / 2;
            }
            
            function animation(currentTime) {
                if (startTime === null) startTime = currentTime;
                const timeElapsed = currentTime - startTime;
                const progress = Math.min(timeElapsed / duration, 1);
                const ease = easeInOutCubic(progress);
                
                window.scrollTo(0, startPosition + distance * ease);
                
                if (timeElapsed < duration) {
                    requestAnimationFrame(animation);
                }
            }
            
            requestAnimationFrame(animation);
        }
        
        // Add smooth scroll to all anchor links (except lightbox triggers)
        document.querySelectorAll('a[href^="#"]:not([data-album])').forEach(anchor => {
            anchor.addEventListener('click', function(e) {
                const href = this.getAttribute('href');
                if (href !== '#' && document.querySelector(href)) {
                    e.preventDefault();
                    smoothScrollTo(href);
                }
            });
        });

            if (socialLightboxEl && socialLightboxEl.classList.contains('active')) {
                socialLightboxEl.classList.remove('active');
            }
            
            lightboxCover.src = album.cover;
            lightboxTitle.textContent = album.title;
            spotifyLink.href = album.spotify;
            appleLink.href = album.apple;
            youtubeLink.href = album.youtube;
            tidalLink.href = album.tidal;
            
            lightbox.classList.add('active');
            document.body.style.overflow = 'hidden';
        }
        
        // Close lightbox
        function closeLightbox() {
            lightbox.classList.remove('active');
            document.body.style.overflow = '';
        }
        
        // Event listeners for opening lightbox
        document.querySelectorAll('[data-album]').forEach(element => {
            element.addEventListener('click', function(e) {
                e.preventDefault();
                const albumId = this.getAttribute('data-album');
                openLightbox(albumId);
            });
        });
        
        // Event listeners for closing lightbox
        lightboxClose.addEventListener('click', closeLightbox);
        lightbox.addEventListener('click', function(e) {
            if (e.target === lightbox) {
                closeLightbox();
            }
        });
        
        // Close lightbox with Escape key
        document.addEventListener('keydown', function(e) {
            if (e.key === 'Escape' && lightbox.classList.contains('active')) {
                closeLightbox();
            }
        });
